import React from "react";
import {
  Carousel,
  CarouselItem,
  CarouselControl,
  CarouselIndicators,
  CarouselCaption
} from "reactstrap";
import "./Activity.css";

class Activity extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      dropdownOpen: false
    };
  }
  toggle() {
    this.setState({
      dropdownOpen: !this.state.dropdownOpen
    });
  }
  render() {
    return (
      <div>
        <h3 className="activityTitle">What's happening here ?</h3>
        <Nav tabs className="navBar">
          <NavItem>
            <NavLink href="#" active>
              Activities
            </NavLink>
          </NavItem>

          <NavItem>
            <NavLink href="#">Animals</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#">Animations</NavLink>
          </NavItem>
        </Nav>
      </div>
    );
  }
}

export default Activity;
